var temp = $HTML.split('<article>');
temp.shift();
var result = [];
temp.map(function (tmp) {
  var title = tmp.split('<span>')[1].split('<')[0];
  var href = tmp.split('<a href="')[1].split('"')[0];
  var date = tmp.split('datetime="')[1].split('T')[0];
  var desc = tmp.split('class="entry">')[1].split('</div>')[0];
  var tag;
  try {
    tag = tmp.split('tags"></i>')[1].split('">')[1].split('<')[0];
  } catch(e) {}
  result.push({
    title: title,
    link: $SITE + href,
    description: desc.replace(/<\/?.+?>/g, '').trim(),
    tags: [{ icon: 'ios-calendar', text: date }],
    category: tag ? [tag] : []
  });
});

return result;

var result = [];
var temp_array = $HTML.split('article-card">');
temp_array.shift();

temp_array.map(function(tmp) {
	result.push({
		title: tmp.split('<a')[1].split('">')[1].split('</')[0],
		link: $SITE + tmp.split('href="')[1].split('">')[0],
		description: tmp.split('article-summary">')[1].split('</div>')[0].trim(),
		category: [tmp.split('tag-code">')[1].split('</')[0]],
		tags: [
            { icon: 'ios-calendar', text: tmp.split('article-date">')[1].split('</')[0] }
		]
    })
});

return result;

var result = [];
var temp_array = $HTML.split('post-type-normal');
temp_array.shift();

temp_array.map(function (tmp) {
  var category;
  try {
    category = tmp.split('href="/categories/')[1].split('/"')[0];
  } catch (e) {
    category = '默认分类';
  }
  var date = tmp.split('datePublished" datetime="')[1].split('"')[0];
  result.push({
    link: $SITE + tmp.split('post-title-link" href="')[1].split('"')[0],
    title: tmp.split('itemprop="url">')[1].split('</')[0].trim(),
    description: tmp.split('itemprop="articleBody">')[1].split('<div')[0].replace(/<\/?.+?>/g, '').trim().substr(0, 200),
    category: [category],
    tags: [
      { icon: 'ios-calendar', text: new Date(date).Format('MM/dd hh:mm') }
    ]
  })
});

return result;

var result = [];
var temp_array = $HTML.split('<!-- display as entry -->');
temp_array.shift();

temp_array.map(function (tmp) {
  var desc;
  try {
    desc = tmp.split('<div class="entry">')[1].split('row">')[1].split('</div')[0].replace(/<\/?.+?>/g,'').trim();
  } catch (e) {}
  if (!desc) desc = '[暂无简介]';
  result.push({
    link: $SITE + tmp.split('<a href="')[1].split('"')[0],
    title: tmp.split('title">')[1].split('</a')[0].split('>')[1],
    description: desc,
    category: [tmp.split('date">')[1].split('</')[0].split('@')[1].trim()]
  })
});

return result;

var result = [];
var temp_array = $HTML.split('<section>');
temp_array.shift();

temp_array.map(function (tmp) {
  var desc;
  try {
    desc = tmp.split('post-content">')[1].split('</')[0].replace(/<\/?.+?>/g,'').trim();
  } catch (e) {}
  if (!desc) desc = '[暂无简介]';
  result.push({
    link: $SITE + tmp.split('href="')[1].split('"')[0],
    title: tmp.split("post-head'>")[1].split('</')[0].trim(),
    description: desc,
    category: [tmp.split('article-category">')[1].split('</')[0].split('>')[1].trim()],
    tags: [
      { icon: 'ios-calendar', text: tmp.split('<time>')[1].split('</')[0] }
    ]
  })
});

return result;

var result = [];
var temp_array = $HTML.split('<article class="post">');
temp_array.shift();

temp_array.map(function (tmp) {
  var desc;
  try {
    desc = tmp.split('entry-content">')[1].split('</div')[0].replace(/<\/?.+?>/g,'').trim();
  } catch (e) {}
  if (!desc) desc = '[暂无简介]';
  var category = [];
  try {
    var tags = tmp.match(/tag">([\w\s]+)<\//g);
    if (tags && tags.length > 0) {
      category = tmp.match(/tag">([\w\s]+)<\//g).map(function(_){return _.split('>')[1].split('<')[0].trim()});
    }
  } catch (e) {}
  if (category.length === 0) category = ['默认分类'];
  result.push({
    link: $SITE + tmp.split('<a href="')[1].split('">')[0],
    title: tmp.split('bookmark">')[1].split('<')[0].trim(),
    description: desc,
    category: category,
    tags: [
      { icon: 'ios-calendar', text: tmp.split('posted-on">')[1].split('<')[0].trim() }
    ]
  })
});

return result;

